            price: "$25"
        },
        {
            id: 8,
            img: "/FeaturedProducts/WechatIMG12.jpg",
            title: "Handmade Press-on Nails",
            price: "$25"
        },

    ]


    return (
        <div className="list">
            {data?.map(item=>(
                <Card item={item} key={item.id}/>
            ))}
        </div>
    )
}

export default List
